    void
    CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Wriggers::full_plane_strain(
            const real& aEmod,
            const real& aNu )
    {
        // unpack invariant related to volume change
        real tJ2 = std::pow( this->volume_change_jacobian(), 2.0 );

        // get the Lame's constants
        real tLame1     = aEmod * aNu / ( ( 1.0 + aNu ) * ( 1.0 - 2.0 * aNu ) );
        real tLame2     = aEmod / ( 2.0 * ( 1.0 + aNu ) );
        real tLameComb1 = tLame1 + 2.0 * tLame2;
        real tLameComb2 = 0.5 * ( tLame1 - tLameComb1 / tJ2 );

        // unpack the components of the inverse of the right Cauchy-Green deformation tensor
        real tInvC11 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 0, 0 );
        real tInvC22 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 1, 0 );
        real tInvC12 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 2, 0 ) / 2.0;

        // compute components of the constitutive tensor 2*dSijdCkl
        mConst( 0, 0 ) = tLameComb1 * tInvC11 * tInvC11;
        mConst( 0, 1 ) = tLameComb1 * tInvC11 * tInvC22 + 2.0 * tLameComb2;
        mConst( 0, 2 ) = tLameComb1 * tInvC11 * tInvC12;

        mConst( 1, 0 ) = mConst( 0, 1 );
        mConst( 1, 1 ) = tLameComb1 * tInvC22 * tInvC22;
        mConst( 1, 2 ) = tLameComb1 * tInvC22 * tInvC12;

        mConst( 2, 0 ) = mConst( 0, 2 );
        mConst( 2, 1 ) = mConst( 1, 2 );
        mConst( 2, 2 ) = tLameComb1 * tInvC12 * tInvC12 - tLameComb2;
    }

