    void
    CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Wriggers::full_3d(
            const real& aEmod,
            const real& aNu )
    {
        // unpack invariant related to volume change
        real tJ2 = std::pow( this->volume_change_jacobian(), 2.0 );

        // get the Lame's constants
        real tLame1     = aEmod * aNu / ( ( 1.0 + aNu ) * ( 1.0 - 2.0 * aNu ) );
        real tLame2     = aEmod / ( 2.0 * ( 1.0 + aNu ) );
        real tLameComb1 = tLame1 + 2.0 * tLame2;
        real tLameComb2 = 0.5 * ( tLame1 - tLameComb1 / tJ2 );

        // unpack the components of the right Cauchy-Green deformation tensor
        real tC11 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 0, 0 );
        real tC12 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 5, 0 ) / 2.0;
        real tC13 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 4, 0 ) / 2.0;
        real tC22 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 1, 0 );
        real tC23 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 3, 0 ) / 2.0;
        real tC33 = this->strain( CM_Function_Type::RIGHT_CAUCHY_GREEN )( 2, 0 );

        // unpack the components of the right Cauchy-Green deformation tensor
        real tInvC11 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 0, 0 );
        real tInvC22 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 1, 0 );
        real tInvC33 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 2, 0 );
        real tInvC23 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 3, 0 ) / 2.0;
        real tInvC13 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 4, 0 ) / 2.0;
        real tInvC12 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 5, 0 ) / 2.0;

        // compute components of the constitutive tensor 2*dSijdCkl
        mConst( 0, 0 ) = tLameComb1 * tInvC11 * tInvC11;
        mConst( 0, 1 ) = tLameComb1 * tInvC11 * tInvC22 + 2.0 * tLameComb2 * tC33;
        mConst( 0, 2 ) = tLameComb1 * tInvC11 * tInvC33 + 2.0 * tLameComb2 * tC22;
        mConst( 0, 3 ) = tLameComb1 * tInvC11 * tInvC23 - 2.0 * tLameComb2 * tC23;
        mConst( 0, 4 ) = tLameComb1 * tInvC11 * tInvC13;
        mConst( 0, 5 ) = tLameComb1 * tInvC11 * tInvC12;

        mConst( 1, 0 ) = mConst( 0, 1 );
        mConst( 1, 1 ) = tLameComb1 * tInvC22 * tInvC22;
        mConst( 1, 2 ) = tLameComb1 * tInvC22 * tInvC33 + 2.0 * tLameComb2 * tC11;
        mConst( 1, 3 ) = tLameComb1 * tInvC22 * tInvC23;
        mConst( 1, 4 ) = tLameComb1 * tInvC22 * tInvC13 - 2.0 * tLameComb2 * tC13;
        mConst( 1, 5 ) = tLameComb1 * tInvC22 * tInvC12;

        mConst( 2, 0 ) = mConst( 0, 2 );
        mConst( 2, 1 ) = mConst( 1, 2 );
        mConst( 2, 2 ) = tLameComb1 * tInvC33 * tInvC33;
        mConst( 2, 3 ) = tLameComb1 * tInvC33 * tInvC23;
        mConst( 2, 4 ) = tLameComb1 * tInvC33 * tInvC13;
        mConst( 2, 5 ) = tLameComb1 * tInvC33 * tInvC12 - 2.0 * tLameComb2 * tC12;

        mConst( 3, 0 ) = mConst( 0, 3 );
        mConst( 3, 1 ) = mConst( 1, 3 );
        mConst( 3, 2 ) = mConst( 2, 3 );
        mConst( 3, 3 ) = tLameComb1 * tInvC23 * tInvC23 - tLameComb2 * tC11;
        mConst( 3, 4 ) = tLameComb1 * tInvC23 * tInvC13 + tLameComb2 * tC12;
        mConst( 3, 5 ) = tLameComb1 * tInvC23 * tInvC12 + tLameComb2 * tC13;

        mConst( 4, 0 ) = mConst( 0, 4 );
        mConst( 4, 1 ) = mConst( 1, 4 );
        mConst( 4, 2 ) = mConst( 2, 4 );
        mConst( 4, 3 ) = mConst( 3, 4 );
        mConst( 4, 4 ) = tLameComb1 * tInvC13 * tInvC13 - tLameComb2 * tC22;
        mConst( 4, 5 ) = tLameComb1 * tInvC13 * tInvC12 + tLameComb2 * tC23;

        mConst( 5, 0 ) = mConst( 0, 5 );
        mConst( 5, 1 ) = mConst( 1, 5 );
        mConst( 5, 2 ) = mConst( 2, 5 );
        mConst( 5, 3 ) = mConst( 3, 5 );
        mConst( 5, 4 ) = mConst( 4, 5 );
        mConst( 5, 5 ) = tLameComb1 * tInvC12 * tInvC12 - tLameComb2 * tC33;
    }

